import './App.css';
import ReactDOM from 'react-dom';

function App() {
    return (
        <div className="App">
            <header id="header">
                <a href="#">Home</a>
                <a href="#">Policy</a>
                <a href="#">Content</a>
            </header>
            <div id="main">
                {tick()}
            </div>
            <footer id="footer">Footer</footer>
        </div>
    );
}

function tick(){
    return Date.now()
}

export default App;
